import React from "react";

class Myclass extends React.Component
{
    id=121;
    name="Girish"
    email="girish@gmail.com"


    constructor(props)
    {
        super(props);
    }

    myfun()
    {
        return "This is Own Function<br />"
    }

    //prepare the component_i/p
    render()
    {
        return(<>
                <h1>React Class Component</h1>
                {this.id}---{this.name}---{this.email}---${myfun()}
                </>);
    }
}
export default Myclass
